import React from 'react';

const SideBar = () => {
  return (
    <div classN="dropdown" style={{ float : "right"}}>
      <img src="/images/SideBar.png" alt="" classN="dropbtn" onclick="myFunction()"/>
      <div classN="dropdown-content">
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
      </div>
      <div data-toggle="dropdown">
      <img src="/images/SideBar.png" alt=""/>
      <div className="dropdown-menu">
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
      </div>
    </div>
    </div>
  );
};

export default SideBar;
